'''Jossik''' is the keeper of the [[Lighthouse]] west of [[Rellekka]]. He also runs [[The Lighthouse Store]] on the {{FloorNumber|uk=1}} of the lighthouse, but players must finish the quest [[Horror from the Deep]] to access it. His store sells various items similar to general stores, but other notable items are several kinds of alcohol and water-filled vial packs. He also sells [[Greenman's Ale]], [[Wizard's mind bomb]], and [[Dwarven stout]]. After you finish the quest, he will give you an empty god book of your choice but it must be one of the main gods: [[Damaged book (Saradomin)|Saradomin]], [[Damaged book (Guthix)|Guthix]], or [[Damaged book (Zamorak)|Zamorak]]. 

==Getting to him==
*[[Fairy ring]] {{fairycode|alp}} places the player right next to the Lighthouse.
*[[Games necklace]] to the [[Barbarian Outpost]] and jump across the basalt rocks to get to the Lighthouse.

==Salvaged prayer books==
Talking to Jossik about prayer books will open up an interface from which you can retrieve completed, incomplete, and missing [[god book]]s. You can also unlock books from different gods for a one-off fee of 5,000 coins each.

It is possible to get multiple copies of completed god books from Jossik for no cost. However, you may only retrieve one copy of incomplete books.

